function ItemListContainer(props) {
  return (
    <div>
        <h1>{props.titulo}</h1>
        <ul>
          {props.ItemsProd.forEach(element => {
            <li>{props.ItemsProd}</li>
          }) 
        }
        </ul>
    </div>
  )
}
export default ItemListContainer
